import React, {useState} from "react";

export function Products() {
  const [content, setContent] = useState(<ProductList showForm={showForm}/>);

  function showList() {
    setContent(<ProductList showForm={showForm}/>);
  }

  function showForm() {
    setContent(<ProductForm showList={showList}/>);
  }

  return (
    <div className="container my-5">
        {content}
    </div>
  );
}


function ProductList(props) {
  return(
    <>
    <h2 className="text-center-mb-3">List of Products</h2>
    <button onClick={() => props.showForm()}typer="button" className="btn btn-primary me-2">Create</button>
    </>
  )
}

function ProductForm(props) {
  return(
    <>
    <h2 className="text-center-mb-3">List New Product</h2>
    <button onClick={() => props.showList()} typer="button" className="btn btn-secondary me-2">Create</button>
    </>
  )
}
